import { Component } from "react";

class ListProgress extends Component {
    constructor(props) {
        super(props);

        this.state = {
            progress: [{ id: 1, description: "Did 30 pushups." }],
        };
    }

    render() {
        return (
            <div>
                <h1>Gym Progress</h1>
                <table>
                    <thead>
                        <tr>
                            <th>Day</th>
                            <th>Description</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <td>{this.state.progress.id}</td>
                            <td>{this.state.progress.description}</td>
                        </tr>
                    </tbody>
                </table>
            </div>
        );
    }
}

export default ListProgress;
